import React from 'react';
import ProductCard from './ProductCard';

function Dashboard() {
  const products = [
    {
      id: 1,
      name: 'Đồng Hồ Rolex',
      description: 'Chất liệu thép không gỉ, chống nước 100m.',
      price: '250,000,000',
      image: 'https://thethaominhphu.com/wp-content/uploads/2017/04/dong-ho-bam-giay-pc894.jpg',
    },
    {
      id: 2,
      name: 'Đồng Hồ Casio',
      description: 'Pin 10 năm, chống sốc cực tốt.',
      price: '2,500,000',
      image: 'https://via.placeholder.com/250x200?text=Casio',
    },
  ];

  return (
    <div>
      <h1>Dashboard Quản Lý Đồng Hồ</h1>
      <div style={{ display: 'flex', flexWrap: 'wrap' }}>
        {products.map((product) => (
          <ProductCard key={product.id} product={product} />
        ))}
      </div>
    </div>
  );
}

export default Dashboard;
